import { LOGIN, SIGNUP } from '../actions/auth'
const initial = {}

export default function (state = initial, action) {
  switch (action.type) {
    case LOGIN:
      if (!action.payload.data) { return null }
      return action.payload.data

    default:
      return state
  }
}
